    /**
     * @param {string} folderPath 
     * @param {import('./fileType').FileType} type
     */
    async processDirectory(folderPath, type) {
        if (!(await exists(folderPath))) return;

        const files = await getAllFilePaths(folderPath);

        for (const file of files) {
            await this.processFile(file, type);
        }
    }

    /**
     * @param {import('./fileType').FileType} type
     * @param {string} pattern
     */
    async processGlob(folderPath, pattern, type) {

        const files = await glob.glob(pattern, { cwd: folderPath })

        switch (type) {
            case 'loot_table': this.#cache.loot_tables = new Set(files.map(x => x.replace(/\\/g, '/')))
                break;
            case 'trade_table': this.#cache.trade_tables = new Set(files.map(x => x.replace(/\\/g, '/')))
                break;
            case 'sound': this.#cache.sounds = new Set(files.map(x => x.replace(/\\/g, '/').replace(new RegExp(path.extname(x), 'g'), '')))
                break;
            case 'function': this.#cache.functions = new Set(files.map(x => x.replace(/\\/g, '/').replace(new RegExp(path.extname(x), 'g'), '').replace('functions/', '')))
                break;
            case 'texture': this.#cache.textures.paths = new Set(files.map(x => x.replace(/\\/g, '/').replace(new RegExp(path.extname(x), 'g'), '')))
                break;
            default: console.warn(`Unknown file type: ${type}`)
                break;
        }

    }

    /**
     * @param {string} file 
     * @param {import('./fileType').FileType} type
     */
    async processFile(file, type) {

        if (!(await exists(file))) return;

        try {

            const text = (await fs.promises.readFile(file)).toString()
            const json = parse(text)
            const fileName = path.basename(file)

            switch (type) {
                case 'entity': this.#processEntityFile(text, json)
                    break;
                case 'item': this.#proceessItemFile(json)
                    break;
                case 'block': this.#processBlockFile(json)
                    break;
                case 'feature': this.#processFeaturefile(json)
                    break;
                case 'script': this.#processScriptFile(text)
                    break;
                case 'structure': this.#processStructureFile(fileName)
                    break;
                case 'bp_animation': this.#processBpAnimationfile(json)
                    break;
                case 'bp_animationcontroller': this.#processBpAnimationControllerfile(json)
                    break;
                case 'rp_animation': this.#processRpAnimationfile(json)
                    break;
                case 'rp_animationcontroller': this.#processRpAnimationControllerfile(json)
                    break;
                case 'block_culling_rule': this.#processBlockCullingRule(json)
                    break;
                case 'particle': this.#processParticle(json)
                    break;
                case 'rendercontroller': this.#processRenderController(json)
                    break;
                case 'model': this.#processModel(text)
                    break;
                case 'rp_entity': this.#processClientEntityFile(json)
                    break;
                case 'fog': this.#processFogFile(json);
                    break;
                case 'item_texture': this.#processItemTextures(json)
                    break;
                case 'terrain_texture': this.#processTerrainTextures(json)
                    break;
                case 'sound_definition': this.#processSoundDefinitions(json)
                    break;
                case 'client_biome':
                    break;
                case 'item_catalog': this.#processCatalog(json)
                    break;
                case 'sounds': this.#processSoundsFile(json)
                    break;
                default: console.warn(`Unknown file type: ${type}`)
                    break;
            }

        } catch (error) {
            console.warn(`Failed to process ${path.basename(file)} -> ${error}`)
        }

    }

    resetEntityCache() {
        this.#cache.entity = {
            ids: new Set(),
            spawnable_ids: new Set(),
            rideable_ids: new Set(),
            boolean_properties: new Set(),
            integer_properties: new Set(),
            float_properties: new Set(),
            enum_properties: new Set(),
            animations: new Set(),
            client_animations: new Set(),
            families: new Set()
        }
    }

    #processSoundsFile(json) {
        this.#cache.block_sounds = typeof json['block_sounds'] == 'object' ? new Set(Object.keys(json['block_sounds'])) : new Set()
    }
    #processCatalog(json) {
        try {
            this.#cache.groups = new Set(json['minecraft:crafting_items_catalog'].categories.flatMap(entry => entry.groups).map(entry => entry.group_identifier).filter(identifier => identifier).map(identifier => identifier.name).filter(name => !name.startsWith('minecraft:')))
        } catch (error) {
            console.log(error)
        }
    }
    #processParticle(json) {
        const identifier = json["particle_effect"]["description"]["identifier"]
        if (identifier) this.#cache.particles.add(identifier)
    }
    #processRenderController(json) {
        Object.keys(json["render_controllers"]).sort().forEach(id => this.#cache.rendercontrollers.add(id))
    }
    #processModel(text) {
        text.match(/"geometry\.([^"]*)"/g).map(x => x.slice(1, -1)).map(x => x.includes(':geometry') ? x.split(':geometry')[0] : x).forEach(id => this.#cache.models.add(id))
    }
    #processSoundDefinitions(json) {
        this.#cache.sound_definitions = typeof json['sound_definitions'] == 'object' ? new Set(Object.keys(json["sound_definitions"]).sort()) : new Set()
    }
    #processBlockCullingRule(json) {
        const identifier = json["minecraft:block_culling_rules"]["description"]["identifier"]
        if (identifier) this.#cache.block_culling_rules.add(identifier)
    }
